Syntax: RAW_TRACEPOINT_PROBE( event ) This is a macro that instruments the raw tracepoint defined by event . The argument is a pointer to struct bpf_raw_tracepoint_args, which is defined in bpf.h . The struct field args contains all parameters of the raw tracepoint where you can found at linux tree include/trace/events directory. For example: RAW_TRACEPOINT_PROBE(sched_switch)
