本文是 eBPF 入门开发实践教程的第八篇，在 eBPF 中使用 exitsnoop 监控进程退出事件，并使用 ring buffer 向用户态打印输出。 使用 ring buffer 向用户态打印输出的步骤和 perf buffer 类似，首先需要定义一个头文件： 头文件：exitsnoop.h #ifndef __BOOTSTRAP_H
