} memptrs SEC(".maps"); struct { __uint(type, BPF_MAP_TYPE_STACK_TRACE); __type(key, u32);
} stack_traces SEC(".maps"); struct alloc_info { __u64 size; __u64 timestamp_ns; int stack_id;
}; union combined_alloc_info { struct { __u64 total_size : 40; __u64 number_of_allocs : 24; }; __u64 bits;
